import React, { Component } from 'react';
import logo from '../photos/templogo.png'


class ContactPage extends Component {


    render() {
        return (
            <div className="contact-page">
                <h1>This is the Contact Page</h1>
            </div>

        );
    }

}



export default ContactPage;
